import React from "react";
import { NavbarStyle, NavbarLink } from "./Styles";

export default function Navbar() {


  const myLinks = () => {
    let hasToken = localStorage.getItem("token") == null ? false : true;
    console.log(localStorage.getItem("token"));
    if (hasToken) {
      return (
      <div>
          <NavbarStyle>
            <NavbarLink onClick={logout}>Logout</NavbarLink>

          </NavbarStyle>
        </div>

      );
    }
    return (
      <div>
        <NavbarStyle >
          <NavbarLink href="/">Home</NavbarLink>
          <NavbarLink href="/login">Login</NavbarLink>
        </NavbarStyle>
      </div>
    );
  };

  return <div>{myLinks()}</div>;
}

